export default {
  isInCart: function isInCart(state) {
    return function (itemId) {
      return state.cartItems.some(function (item) {
        return item.objectID == itemId;
      });
    };
  },
  isInWishList: function isInWishList(state) {
    return function (itemId) {
      return state.wishList.some(function (item) {
        return item.objectID == itemId;
      });
    };
  },
  getCartItem: function getCartItem(state) {
    return function (itemId) {
      var result = state.cartItems.filter(function (item) {
        return item.objectID == itemId;
      });
      return result.length ? result.pop() : [];
    };
  }
};
